window.bookSummaryJSON = "<p><b>A monster is holding me prisoner in the land of Faerie.</b></p> <p>They call him the lord of the water Fae. I call him a viper.</p> <p>The tales say Elixir is venomous—and as beautiful as he is brutal. They say he's a cursed soul who wields dark, sinful magic.</p> <p>As punishment for stumbling into his dangerous world, the ruler of the river has confined me to an underground realm of serpentine creatures and secret canals.</p> <p>The key to escape rests with my fatal enemy. To win my freedom, I'll have to play his wicked mind games—and unlock his greatest weakness.</p> <p>It's a risk I must take–even if it means being trapped with my villainous Fae captor. And even if it means fighting off the forbidden heat that ignites between us.</p> <p>If I don't make it out alive, his sensual touch might deliver the killing blow.</p> <p>Curse the Fae <i>is the third book in Natalia Jaster's sexy fantasy romance series, Dark Fables: Vicious Faeries. If you like heavy steam, forbidden enemies to lovers, and a grumpy sunshine slow burn between a rebellious mortal and a hot, brooding shifter, prepare to swoon like a human. This is a spicy new adult fantasy romance intended for mature listeners.</i></p>"; 
